import React, {useEffect, useState} from "react";
import axios from "axios";

const Province = () => {
    const [province, setprovince] = useState([]);
    let token = 'Bearer 1|XXfI3BOr01VoBYgF8nC27oD7KEN1Oh3EULg68Q4a';
    useEffect(() => {
        axios.get(`http://localhost:5000/api/province`,
            {
                headers : {
                    Accept: 'application/json',
                    'Content-Type' : 'application/json',
                    Authorization : token
                }
            }
        ).then((response) => {
            setprovince(response.data.data);
        }).catch((error) => {
            alert(error)
        })
    }, [])
    return(
        <>
            <div className="card">
                <div className="card-body">
                  <h5 className="card-title"> <a href="" data-bs-toggle="modal" data-bs-target="#addville" className="btn btn-primary"> + Ville</a></h5>
                  <div className="table-responsive">
                    <table
                      id="zero_config"
                      className="table table-striped table-bordered"
                    >
                      <thead>
                        <tr>
                          <th>Province</th>
                          <th>Pays</th>
                          <th>Action</th>
                        </tr>
                      </thead>
                      <tbody>
                            {
                                province.map((e) => {
                                    return(
                                        <tr>
                                            <td>{e.province}</td>
                                            <td>{e.id_pays}</td>
                                            <td>
                                                <button className="btn btn-primary"><i className="fa fa-edit"></i></button> &nbsp;
                                                <button className="btn btn-primary"><i className="fa fa-edit"></i></button>
                                            </td>
                                        </tr>
                                    )
                                })
                            }
                    </tbody>
                    </table>
                  </div>
                </div>
              </div>
        </>
    )
}

export default Province;
